import React from 'react';
import { StyleSheet, Text, View, ScrollView, Image, Dimensions, ImageBackground, Button } from 'react-native';
import { WebView } from 'react-native-webview';

const Shop = () => {
    return (
        <ScrollView>
          <WebView 
          source={{uri: 'https://durasafe.com.sg'}}
          style={{marginTop}}
          >
          </WebView>
        </ScrollView>
    );
}
export default Shop
